package rtp

var ulawEngine = newUlawEngine()
var alawEngine = newAlawEngine()

func PCM2G711U(data []int16) []byte {
	count := len(data)
	res := make([]byte, count)
	for i, d := range data {
		res[i] = ulawEngine.CompressTable[int(uint16(d))]
	}
	return res
}

func PCM2G711A(data []int16) []byte {
	count := len(data)
	res := make([]byte, count)
	for i, d := range data {
		res[i] = alawEngine.CompressTable[int(uint16(d))]
	}
	return res
}

func G711U2PCM(frame []byte) []int16 {
	count := len(frame)
	if len(frame) == 0 {
		return nil
	}
	res := make([]int16, count)
	for i, d := range frame {
		res[i] = ulawEngine.DecompressTable[int(d&0xFF)]
	}
	return res
}

func G711A2PCM(frame []byte) []int16 {
	count := len(frame)
	if count == 0 {
		return nil
	}
	res := make([]int16, count)
	for i, d := range frame {
		res[i] = alawEngine.DecompressTable[int(d&0xFF)]
	}
	return res
}

